import React from 'react';
import { Box, Typography, Button, Container, Grid } from '@mui/material';
import { motion } from 'framer-motion';
import { Link as RouterLink } from 'react-router-dom';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
import EmailIcon from '@mui/icons-material/Email';

const Home = () => {
  return (
    <div className="home">
      <motion.section 
        className="hero"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
      >
        <motion.h1
          initial={{ scale: 0.8 }}
          animate={{ scale: 1 }}
          transition={{ duration: 0.5, delay: 0.2 }}
        >
          Welcome to My Portfolio
        </motion.h1>
        <motion.p
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 0.5, delay: 0.4 }}
        >
          I'm a Full Stack Developer passionate about creating amazing web experiences
        </motion.p>
        <motion.div 
          className="social-links"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 0.5, delay: 0.6 }}
        >
          <a 
            href="https://www.linkedin.com/in/vidura-lakshitha-4b6362338" 
            target="_blank" 
            rel="noopener noreferrer"
            className="social-link"
          >
            <LinkedInIcon /> LinkedIn
          </a>
          <a 
            href="https://github.com/ViduraLakshitha" 
            target="_blank" 
            rel="noopener noreferrer"
            className="social-link"
          >
            <GitHubIcon /> GitHub
          </a>
          <a 
            href="mailto:viduralakshitha@gmail.com" 
            className="social-link"
          >
            <EmailIcon /> Email
          </a>
        </motion.div>
      </motion.section>

      <motion.section 
        className="about"
        initial={{ opacity: 0, x: -50 }}
        animate={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.8, delay: 0.6 }}
      >
        <h2>About Me</h2>
        <p>
          I'm a dedicated developer with expertise in modern web technologies.
          I love building responsive, user-friendly applications that solve real-world problems.
          Connect with me on <a href="https://www.linkedin.com/in/vidura-lakshitha-4b6362338" target="_blank" rel="noopener noreferrer">LinkedIn</a> to learn more about my professional journey.
        </p>
      </motion.section>

      <motion.section 
        className="skills"
        initial={{ opacity: 0, x: 50 }}
        animate={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.8, delay: 0.8 }}
      >
        <h2>Skills</h2>
        <div className="skills-grid">
          <motion.div 
            className="skill-card"
            whileHover={{ scale: 1.05 }}
            transition={{ duration: 0.3 }}
          >
            <h3>Frontend</h3>
            <ul>
              <motion.li
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.3, delay: 1 }}
              >
                React
              </motion.li>
              <motion.li
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.3, delay: 1.2 }}
              >
                JavaScript
              </motion.li>
              <motion.li
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.3, delay: 1.4 }}
              >
                HTML/CSS
              </motion.li>
            </ul>
          </motion.div>
          <motion.div 
            className="skill-card"
            whileHover={{ scale: 1.05 }}
            transition={{ duration: 0.3 }}
          >
            <h3>Backend</h3>
            <ul>
              <motion.li
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.3, delay: 1.6 }}
              >
                Node.js
              </motion.li>
              <motion.li
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.3, delay: 1.8 }}
              >
                Express
              </motion.li>
              <motion.li
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.3, delay: 2 }}
              >
                MongoDB
              </motion.li>
            </ul>
          </motion.div>
        </div>
      </motion.section>
    </div>
  );
};

export default Home;
